import Task from './Task'

const Tasks = ({ tasks, onDelelte }) => {
  return (
    <>
      {tasks.map((task) => (
        <div>
          <Task key={task.id} task={task} onDelelte={onDelelte} />
        </div>
      ))}
    </>
  )
}

export default Tasks
